import React from 'react';
import { Tabs } from 'antd';
import { HomeOutlined, DashboardOutlined, TeamOutlined, UserOutlined } from '@ant-design/icons';
import '../../Styles/PrincipalAdmin.css';
import ContenidoPrincipalAdministrador from './ContenidoPrincipalAdministrador';
import fetchUsersData from './VerAjustadores';

const { TabPane } = Tabs;

const PrincipalAdmin = () => {

  return (
    <div className="app-container">
      <div className="content">
        <Tabs
          defaultActiveKey="1"
          tabPosition="bottom"
          size="large"
          animated
          className="custom-tabs"
        >
          <TabPane
            tab={
              <span>
                <HomeOutlined />
              </span>
            }
            key="1"
          >
            <ContenidoPrincipalAdministrador/>
          </TabPane>
          <TabPane
            tab={
              <span>
                <TeamOutlined />
                </span>
            }
            key="2"
          >
            <h2>Registro de siniestros</h2>
            <br></br>
            <br></br>
            <br></br>
            <br></br>

          </TabPane>
          <TabPane
            tab={
              <span>
                <DashboardOutlined />
              </span>
            }
            key="3"
          >
            <h2>Contenido de Likes</h2>
          </TabPane>
          <TabPane
            tab={
              <span>
                <UserOutlined />
              </span>
            }
            key="5"
          >
            <h2>Contenido de Profile</h2>
          </TabPane>
        </Tabs>
      </div>

    </div>
  );
};

export default PrincipalAdmin;
